      MODULE mHH4th
        IMPLICIT NONE
! degrees of freedom
!**!        INTEGER, PARAMETER :: DOF = 2
! parameters 
        !**!REAL(8), PARAMETER :: U = 10.0d0/100.0d0
! Planck constant 
!**!        double precision, PARAMETER :: Hbar = 1.0d0
! width parameter
!**!        double precision, PARAMETER :: WG = 0.1d0
! mass 
!**!        double precision, PARAMETER :: Mass = 1.0d0
! omega
!**!        double precision, PARAMETER :: Omega = 1.0d0
! anharmonicity parameter 
!**!        double precision, PARAMETER :: CQ = 0.01d0

      CONTAINS
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!**!        FUNCTION Total_energy(Q, P)
!**!          double precision :: Total_energy
! coordinates and momenta
!**!          double precision, INTENT(IN) :: Q, P 
!%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%         
!**!          Total_energy = 0.5d0*(P**2)/Mass &
!**!            + 0.5d0*Mass*(Omega**2)*(Q**2) + CQ*(Q**4)  
!**! 
!**!        END FUNCTION Total_energy
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
        FUNCTION UniformRandomNumber(I)
          double precision :: UniformRandomNumber
! parameter 
          INTEGER, PARAMETER :: L = 843314861, JC = 453816693, JT30 = 2**30
          double precision, PARAMETER :: DMU = 2.d0**31
! seed for random numbers
          INTEGER, INTENT(INOUT) :: I
!%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%	
          I = L*I + JC
          IF(I.LT.0) I = (I + JT30) + JT30
          UniformRandomNumber = DBLE(I)/DMU

        END FUNCTION UniformRandomNumber
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
