!**!        SUBROUTINE Importance_sampling(Seed, Initial_condition)
! seeds for random numbers(input/output)
!**!          INTEGER, DIMENSION(:), INTENT(INOUT) :: Seed
! initial condition(output)
!**!          double precision, DIMENSION(SIZE(Seed)), INTENT(OUT) :: Initial_condition
! uniform random number in the range(-1, +1)
!**!          double precision, DIMENSION(SIZE(Seed)) :: Uniform_random_number
! width of distribution, 'square of radius'
!**!          double precision :: Width_of_distribution, Square_of_radius
! cos or sin
!**!          double precision, DIMENSION(2) :: Cosine_Sine 
!%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
! uniform random number in the range(-1, +1)
!**!          Uniform: DO
!**!            Uniform_random_number(1) = &
!**!              2.0d0*UniformRandomNumber(Seed(1)) - 1.0d0
!**!            Uniform_random_number(2) = &
!**!              2.0d0*UniformRandomNumber(Seed(2)) - 1.0d0
! width of the distribution 
!**!            Width_of_distribution = 2.0d0*Hbar/WG
! calculating 'square of radius'
!**!            !Square_of_radius = Uniform_random_number(1)**2 + Uniform_random_number(2)**2
!**!            Square_of_radius = SUM(Uniform_random_number * Uniform_random_number)
!**!            IF(Square_of_radius <= (1.0d0))EXIT
!**!          END DO Uniform
!**!          Cosine_Sine = Uniform_random_number/DSQRT(Square_of_radius)
!**!          Initial_condition = DSQRT(- Width_of_distribution*LOG(Square_of_radius))*Cosine_Sine
!**!
!**!        END SUBROUTINE Importance_sampling
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!**!        SUBROUTINE DerivsC(Y, DYDX)
! 
!**!          double precision, DIMENSION(:), INTENT(IN) :: Y
! 
!**!          double precision, DIMENSION(:), INTENT(OUT) :: DYDX
!**!
!%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
! 
!**!          DYDX(1) = Y(2)/Mass
!**!          DYDX(2) = - (Mass*(Omega**2)*Y(1) + 4.0d0*CQ*(Y(1)**3))
!**!          
!**!        END SUBROUTINE DerivsC
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!**!      SUBROUTINE RungeKutta4thC(Y, DYDX, H, Yout)
! 
!**!        double precision, DIMENSION(:), INTENT(IN) :: Y
! 
!**!        double precision, DIMENSION(:), INTENT(IN) :: DYDX
! 
!**!        double precision, INTENT(IN) :: H
! 
!**!        double precision, DIMENSION(:), INTENT(OUT) :: Yout
! 
!**!        double precision :: HH, H6, XH
! 
!**!        double precision, DIMENSION(SIZE(Y)) :: Yt, DYt, DYm
!**!
! 
!**!        HH = H*0.5d0
!**!        H6 = H/6.0d0
!!!		XH = X + HH
!  
!**!        Yt = Y + HH*DYDX
!!!        CALL Derivs(XH, Yt, DYt)
!**!        CALL DerivsC(Yt, DYt)
! 
!**!        Yt = Y + HH*DYt
!!!		CALL Derivs(XH, Yt, DYm)
!**!        CALL DerivsC(Yt, DYm)
! 
!**!        Yt = Y + H*DYm
!**!        DYm = DYt +DYm
!!!		CALL Derivs(X + H, Yt, DYt)
!**!        CALL DerivsC(Yt, DYt)
! ÅI“I‚ÈŒ‹‰Ê
!**!        Yout = Y + H6*(DYDX + DYt + 2.0d0*DYm)
!**!
!**!      END SUBROUTINE RungeKutta4thC
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
!$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$$
      END MODULE mHH4th

